import * as React from "react";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import TextField from "@mui/material/TextField";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import Link from "@mui/material/Link";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import { createTheme, ThemeProvider } from "@mui/material/styles";

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright © "}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const theme = createTheme();

export default function PwaTest() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get("email"),
      password: data.get("password"),
    });
  };

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Registration form
          </Typography>
          <Box
            component="form"
            onSubmit={handleSubmit}
            noValidate
            sx={{ mt: 1 }}
          >
            <TextField
              margin="normal"
              required
              fullWidth
              id="name"
              label="Name"
              name="name"
              autoComplete="name"
              autoFocus
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="Mobile"
              label="Mobile number"
              // type="password"
              id="password"
              autoComplete="current-password"
            />

            <Grid container justifyContent="flex-start">
            <Grid  spacing="8">
            <TextField
            margin="normal"
            required
            fullWidth
            name="Pan Number"
            label="PAN number"
            // type="password"
            id="password"
            autoComplete="current-password"
          />
                <p style={{fontSize:"10px",marginTop}}> Your PAN  is required to check credit details and will help us in giving you an accurate offer</p>
            </Grid>
          </Grid>
            <TextField
              margin="normal"
              required
              fullWidth
              name="email"
              label="Email id"
              type="email"
              // id="password"
              autoComplete="current-password"
            />
            <Grid container justifyContent="flex-start">
              <Grid item>
                <FormControlLabel
                  control={<Checkbox value="remember" color="primary" />}
                />
                <typography>
                  {" "}
                  Consent to override any DND subscription, Bussiness Executive
                  to contact and fetch CIBIL score to process loan request
                </typography>
              </Grid>
            </Grid>
            <Grid container justifyContent="flex-start">
              <Grid  spacing="8">
                <Button variant="contained" color="success">
                  Submit
                </Button>
              </Grid>
            </Grid>

          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

